INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES ("2020/07/31 12:00:00", 401, 10046, 2, 24001, "やったね、ぷうきち！\nこれならお兄ちゃんたちの\nお手本になれたよね！", 0.0, 24, 2, 102301, "2030/12/17 14:59:59", 0.0, "アヤネ", 0.0);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES ("2020/07/31 12:00:00", 402, 10046, 1, 24002, "私たちの勝ちだね！\nぷうきちと一緒なら\nどんなボールでも\nホームランを打ってみせるよ！", 2.21, 24, 2, 102301, "2030/12/17 14:59:59", 0.0, "アヤネ", 0.0);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES ("2020/07/31 12:00:00", 403, 10046, 2, 24003, "やったやったぁ！\nお兄ちゃん、見ててくれた？\n私、すっごくがんばったよ！", 0.0, 24, 2, 102301, "2030/12/17 14:59:59", 0.0, "アヤネ", 0.0);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES ("2020/07/31 12:00:00", 701, 10046, 2, 24004, "特訓の成果が出たみたいだ！\nもっと練習を重ねて\nこの調子で上達していこう！", 1.99, 24, 1, 192201, "2030/12/17 14:59:59", 0.0, "アサヒ", 0.0);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES ("2020/07/31 12:00:00", 702, 10046, 1, 24005, "よし、いい感じだ！\nキャプテンとしての仕事は\nきっちり果たせそうだよ", 2.21, 24, 2, 192201, "2030/12/17 14:59:59", 0.0, "アサヒ", 0.0);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES ("2020/07/31 12:00:00", 703, 10046, 2, 24006, "試合に向けて\nいい感覚を掴めた気がするよ！\nこのまま一気に全国大会だ！", 3.33, 24, 1, 192201, "2030/12/17 14:59:59", 0.0, "アサヒ", 0.0);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES ("2020/07/31 12:00:00", 801, 10046, 2, 24007, "このくらい余裕だ\nオレたちは全国大会を\n目指してるんだからな", 0.0, 24, 2, 192301, "2030/12/17 14:59:59", 0.0, "部員３", 0.0);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES ("2020/07/31 12:00:00", 802, 10046, 1, 24008, "オレだって\nビーチベースボール選手だ\nどんな球だろうが\n全部スタンドまで飛ばしてやる", 2.68, 24, 2, 192301, "2030/12/17 14:59:59", 0.0, "部員３", 0.0);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES ("2020/07/31 12:00:00", 803, 10046, 2, 24009, "いい感じだ\nこれなら試合でも活躍できそうだ\n大暴れしてやる！", 0.0, 24, 2, 192301, "2030/12/17 14:59:59", 0.0, "部員３", 0.0);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES ("2020/07/31 12:00:00", 501, 10046, 1, 24010, "やった！", 0.0, 24, 1, 192501, "2030/12/17 14:59:59", 0.0, "", 0.0);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES ("2020/07/31 12:00:00", 502, 10046, 1, 24011, "勝ったよ！", 0.0, 24, 1, 192501, "2030/12/17 14:59:59", 0.0, "", 0.0);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES ("2020/07/31 12:00:00", 503, 10046, 1, 24012, "いい調子！", 0.0, 24, 1, 192501, "2030/12/17 14:59:59", 0.0, "", 0.0);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES ("2020/07/31 12:00:00", 111, 10046, 6, 24013, "あら～…もしかして\n勝っちゃったのかしら？\nみんなの練習を見ていたから\nかもしれないわね", 5.33, 24, 2, 113501, "2030/12/17 14:59:59", 0.0, "ミサト", 0.0);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES ("2020/07/31 12:00:00", 112, 10046, 1, 24014, "みんなの力になりたくて\n先生も頑張ってみました～！\nうまく投げられたみたいで\nよかったわ～！", 6.85, 24, 2, 113501, "2030/12/17 14:59:59", 0.0, "ミサト", 0.0);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES ("2020/07/31 12:00:00", 113, 10046, 1, 24015, "練習お疲れさま～！\n先生も協力できて\nとってもうれしいわ～♪\n次も頑張りましょうね～！", 3.0, 24, 2, 113501, "2030/12/17 14:59:59", 0.0, "ミサト", 0.0);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES ("2020/07/31 12:00:00", 611, 10046, 1, 24016, "まだ練習が足りねえみてえだな\nこれっぽっちも本気で\n投げてねえっつーの\nもう一回やんぞ！", 6.11, 24, 2, 192401, "2030/12/17 14:59:59", 0.0, "ダイチ", 0.0);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES ("2020/07/31 12:00:00", 612, 10046, 1, 24017, "ふん、当然の結果だな\n俺の球は、誰にも打てねえよ！\nまたやりてえっつーなら\nとことん付き合ってやるぜ！", 6.75, 24, 2, 192401, "2030/12/17 14:59:59", 0.0, "ダイチ", 0.0);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES ("2020/07/31 12:00:00", 613, 10046, 2, 24018, "おっしゃあ！\nこの勢いで全国に行ってやるぜ！\n全員三振で仕留めてやる！", 0.0, 24, 2, 192401, "2030/12/17 14:59:59", 0.0, "ダイチ", 0.0);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES ("2020/07/31 12:00:00", 211, 10046, 2, 24019, "きらーん☆\nハツネちゃんの大勝利なのだ～！\nみんながもっと上達できるように\n私もまだまだ頑張るからね！", 4.52, 24, 1, 113401, "2030/12/17 14:59:59", 0.0, "ハツネ", 0.0);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES ("2020/07/31 12:00:00", 212, 10046, 2, 24020, "やったあ！　私の勝ちだね！\nチアリーダーもピッチャーも\nハツネちゃんに任せてよ！", 3.89, 24, 1, 113401, "2030/12/17 14:59:59", 0.0, "ハツネ", 0.0);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES ("2020/07/31 12:00:00", 213, 10046, 1, 24021, "よお～し、この調子でもっと\n頑張ろう…と思ったけど\n超能力を使ったから…\n眠くなってきちゃった…すやぁ…", 13.49, 24, 2, 113401, "2030/12/17 14:59:59", 0.0, "ハツネ", 0.0);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES ("2020/07/31 12:00:00", 311, 10046, 1, 24022, "いい勝負だったぜ！\nたぎっちまって\nつい本気で投げちまったよ", 3.17, 24, 2, 106501, "2030/12/17 14:59:59", 0.0, "カヤ", 0.0);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES ("2020/07/31 12:00:00", 312, 10046, 1, 24023, "どうだ？\nオレ様のボールは熱かっただろ！\nま、でもおまえらの根性も\nなかなかのもんだったぜ", 4.42, 24, 2, 106501, "2030/12/17 14:59:59", 0.0, "カヤ", 0.0);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES ("2020/07/31 12:00:00", 313, 10046, 6, 24024, "なんだよ、そんなもんか？\nこっちはまだまだ投げたりねえ\nもっと勝負しようぜ！", 2.89, 24, 1, 106501, "2030/12/17 14:59:59", 0.0, "カヤ", 0.0);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES ("2020/07/31 12:00:00", 421, 10046, 4, 24025, "あとちょっとだったのに～！\n次こそぷうきちと一緒に\n勝ってみせるからね！", 3.71, 24, 3, 102301, "2030/12/17 14:59:59", 0.0, "アヤネ", 0.0);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES ("2020/07/31 12:00:00", 721, 10046, 2, 24026, "いい勝負だったね！\nでも、やっぱり悔しいな…\nもっと練習して\n今度は絶対に俺が勝つから！", 5.1, 24, 1, 192201, "2030/12/17 14:59:59", 0.0, "アサヒ", 0.0);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES ("2020/07/31 12:00:00", 821, 10046, 1, 24027, "ちっ…あと一歩足りなかったか\n次こそは絶対に勝つから\nそのつもりでいろ", 4.34, 24, 3, 192301, "2030/12/17 14:59:59", 0.0, "部員３", 0.0);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES ("2020/07/31 12:00:00", 521, 10046, 1, 24028, "いい勝負だったよ\nまたやろうね", 0.0, 24, 1, 192501, "2030/12/17 14:59:59", 0.0, "", 0.0);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES ("2020/07/31 12:00:00", 101, 10046, 1, 24029, "とってもよくできました～♪\n頑張ってくれて先生うれしいわ\nこれからも試合に向けて\n練習していきましょうね～", 5.62, 24, 2, 113501, "2030/12/17 14:59:59", -360.0, "ミサト", 0.0);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES ("2020/07/31 12:00:00", 102, 10046, 1, 24030, "頑張った成果ね～！\nこのまま練習を続ければ\nもっとすごい成績を残せそうよ\n期待してますからね～！", 9.58, 24, 2, 113501, "2030/12/17 14:59:59", -360.0, "ミサト", 0.0);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES ("2020/07/31 12:00:00", 103, 10046, 2, 24031, "いい子、いい子～♪\n頑張り屋さんのあなたを\nたっくさん褒めてあげますからね", 0.0, 24, 2, 113501, "2030/12/17 14:59:59", -360.0, "ミサト", 0.0);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES ("2020/07/31 12:00:00", 104, 10046, 2, 24032, "夢に向けて、一歩前進できたわね\nこの調子で、夢を叶えましょう\n目指せ、全国大会～！", 9.13, 24, 1, 113501, "2030/12/17 14:59:59", -360.0, "ミサト", 0.0);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES ("2020/07/31 12:00:00", 105, 10046, 1, 24033, "絶好調ね～♪\nきっと試合でも大活躍\n間違いなしだわ\n楽しみにしていますからね～！", 8.27, 24, 2, 113501, "2030/12/17 14:59:59", -360.0, "ミサト", 0.0);
